// src/components/h1vertical/H1Vertical.js
import React from 'react'
import './H1Vertical.css'

const H1Vertical = ({
  side = 'left',
  text = 'Note Taker',
  reverse = false,
}) => {
  return (
    <div className={`vertical-container ${side}`}>
      <h1
        className={`h1vertical text-white text-5xl font-bold ${reverse ? 'reverse' : ''}`}
      >
        {text}
      </h1>
    </div>
  )
}

export default H1Vertical
